case 2. Improvement to existing type definition.
SuggestionSelectedEventData converted to be a generic interface, so type of the suggestion property can be defined by the consumer.

It's useful because I don't have to cast the suggestion to the appropriate type in the event handler:

```
    protected onSuggestionsSelected(event: React.FormEvent, data: ReactAutosuggest.SuggestionSelectedEventData<Language>) {
        alert(`Selected language is ${data.suggestion.name} (${data.suggestion.year}).`);
    }
```

other middleware can add properties to `Koa.Request`, `Koa.Response`, `Koa.Context`

```
declare namespace Koa {

    // These open interfaces may be extended in an application-specific manner via declaration merging.
    // See for example method-override.d.ts (https://github.com/DefinitelyTyped/DefinitelyTyped/blob/master/method-override/method-override.d.ts)
    export interface Request { }
    export interface Response { }
    export interface Context { }
    export interface Application { }
}
```

Installing the `moment` typings using the following typings.json

```
{
  "globalDependencies": {
    "moment": "registry:dt/moment"
  }
}
```

results in the TypeScript error `Error:(3, 21) TS2503: Cannot find namespace 'moment'.`.
The reason is the auto-generated `index.d.ts` contains only the content of the `moment.d.ts` file.
The referenced file `moment-node.d.ts` is not downloaded.

Solution:   Merged `moment-node.d.ts` into `moment.d.ts` and delete `moment-node.d.ts`

The `complete` variable is described as (true|false) if the status is completed.

Quickstart instructions has `complete` in the example.

``` javascript
var ProgressBar = require('progress');

var bar = new ProgressBar(':bar', { total: 10 });
var timer = setInterval(function () {
  bar.tick();
  if (bar.complete) {
    console.log('\ncomplete\n');
    clearInterval(timer);
  }
}, 100);
```

